import jsPDF from 'jspdf';
import logo from '../assets/mapfre-logo.png';

// Pega aqu√≠ tu string base64 largo de la imagen
const fondoPortada = 'data:image/png;base64,' + '';





export function generarPDFCompleto(formValues) {
  const doc = new jsPDF();
  const width = doc.internal.pageSize.getWidth();
  const height = doc.internal.pageSize.getHeight();

  // PORTADA
  doc.addImage(fondoPortada, 'JPEG', 0, 0, width, height);

  doc.setTextColor(255, 255, 255);
  doc.setFontSize(28);
  doc.text('REPORTE DE INSPECCI√ìN', width / 2, 80, { align: 'center' });


  // Datos din√°micos centrados
  doc.setFontSize(16);
  doc.text(`Asegurado: ${formValues.razonSocial || '---'}`, width / 2, 200, { align: 'center' });
  doc.text(`Fecha de visita: ${formValues.fechaVisita || '---'}`, width / 2, 210, { align: 'center' });
  doc.text('A√±o: 2025', width / 2, 220, { align: 'center' });

  // Pie de p√°gina
  doc.setFontSize(10);
  doc.text('VERIFICACI√ìN DE RIESGOS | RIESGO INDUSTRIAL', width / 2, height - 20, { align: 'center' });

  // √çNDICE
  doc.addPage();
  doc.setFontSize(18);
  doc.setTextColor(0);
  doc.text('√çndice', 20, 30);
  const secciones = [
    'Informaci√≥n General',
    'Resumen del Riesgo',
    'Riesgos CAT',
    'Inmueble',
    'Actividad',
    'Gesti√≥n',
    'Seguridad Patrimonial',
    'Control',
  ];
  secciones.forEach((titulo, i) => {
    doc.setFontSize(12);
    doc.text(`${i + 1}. ${titulo}`, 30, 45 + i * 10);
  });

  // FUNCION PARA AGREGAR SECCIONES
  const renderSeccion = (titulo, data) => {
    doc.addPage();
    doc.setFontSize(16);
    doc.setTextColor(216, 30, 5);
    doc.text(`${titulo}`, 20, 30);
    doc.setFontSize(12);
    doc.setTextColor(0);

    let y = 50;
    for (const [label, value] of Object.entries(data)) {
      doc.setFillColor(240); // gris claro columna izquierda
      doc.rect(20, y - 5, 50, 10, 'F');
      doc.setFont(undefined, 'bold');
      doc.text(`${label}`, 22, y + 2);
      doc.setFont(undefined, 'normal');
      doc.text(`${value || '---'}`, 75, y + 2);
      y += 15;
      if (y > 270) {
        doc.addPage();
        y = 30;
      }
    }
  };

  // SECCIONES
  renderSeccion('Informaci√≥n General', {
    'Raz√≥n Social': formValues.razonSocial,
    'Direcci√≥n': formValues.direccion,
    'Fecha de Visita': formValues.fechaVisita,
    'Ingeniero': formValues.ingeniero,
    'Suscriptor': formValues.suscriptor,
  });

  renderSeccion('Resumen del Riesgo', {
    'Dictamen': formValues.tieneDictamen,
    'Da√±os': formValues.da√±os,
    'Deterioro': formValues.deterioro,
    'Descripci√≥n': formValues.descripcionRiesgo,
    'Siniestralidad': formValues.siniestralidad,
    'Detalle': formValues.detalleSiniestralidad,
  });

  // Puedes seguir con m√°s renderSeccion(...) para el resto

  doc.save('reporte-inspeccion.pdf');
}
